import { SET_LOGIN, SET_LOGOUT } from "./authTypes"
const setLogin = () => {
    return {
        type : SET_LOGIN
    }   
}
const setLogout = () => {
    return {
       type : SET_LOGOUT
    }  
}


export {
    setLogin,
    setLogout
}
